      "originalJapaneseLine": "大将軍ヨシフが部下からの",
      "translatedEnglishLine": "Generalissimo Yosif was looking over"
    },
    {
      "lineNumber": 169883,
      "originalJapaneseLine": "報告をまとめた書類を眺め、満足げに頷いた。",
      "translatedEnglishLine": "the compiled documents of reports from his subordinates and nodded with satisfaction."
    },
    {
      "lineNumber": 169884,
      "originalJapaneseLine": "「ふう、ようやくリーザス国民の",
      "translatedEnglishLine": "\"Phew, we have finally"
    },
    {
      "lineNumber": 169885,
      "originalJapaneseLine": "　正確な人数が把握できたようだな」",
      "translatedEnglishLine": "accurately grasped the exact number of Liesath's citizens.\""
    },
    {
      "lineNumber": 169886,
      "originalJapaneseLine": "「ケイブリス様の命令は、",
      "translatedEnglishLine": "\"Lord Keivris's order is"
    },
    {
      "lineNumber": 169887,
      "originalJapaneseLine": "　人口を八割減にすること」",
      "translatedEnglishLine": "to reduce the population by eighty percent.\""
    },
    {
      "lineNumber": 169888,
      "originalJapaneseLine": "「各街の人間共の管理を徹底させろ、",
      "translatedEnglishLine": "\"Make management of the people in every town thorough,"
    },
    {
      "lineNumber": 169889,
      "originalJapaneseLine": "　毒餌でもなんでも方法は問わん。",
      "translatedEnglishLine": "using poison bait or any method, it does not matter."
    },
    {
      "lineNumber": 169890,
      "originalJapaneseLine": "　とにかく計画的に殺害を続けろ」",
      "translatedEnglishLine": "Just continue the killings systematically.\""
    },
    {
      "lineNumber": 169891,
      "originalJapaneseLine": "「我が計画に、一ミリの狂いも許さん。",
      "translatedEnglishLine": "\"I will not allow even one millimeter of deviation from my plan."
    },
    {
      "lineNumber": 169892,
      "originalJapaneseLine": "　そのつもりでおれ」",
      "translatedEnglishLine": "Keep that in mind.\""
    },
    {
      "lineNumber": 169893,
      "originalJapaneseLine": "「はっ！　もちろんでございます！」",
      "translatedEnglishLine": "\"Yes! Of course!\""
    },
    {
      "lineNumber": 169894,
      "originalJapaneseLine": "「うんうん、さっすがヨシフにゃん！",
      "translatedEnglishLine": "\"Mm-hmm, as expected of Yosif-nyan!"
    },
    {
      "lineNumber": 169895,
      "originalJapaneseLine": "　ちゃーんとリス様の命令を",
      "translatedEnglishLine": "You’re properly carrying out Lord Lis's orders"
    },
    {
      "lineNumber": 169896,
      "originalJapaneseLine": "　こなしているようにゃんな」",
      "translatedEnglishLine": "like a good little kitty.\""
    },
    {
      "lineNumber": 169897,
      "originalJapaneseLine": "「これはケイブニャン様、ケイブワン様」",
      "translatedEnglishLine": "\"Here we have Lord Keibunyan and Lord Keibuwan.\""
    },
    {
      "lineNumber": 169898,
      "originalJapaneseLine": "「リーザス制圧が成ったと聞いて、",
      "translatedEnglishLine": "\"We heard Liesath has been subdued,"
    },
    {
      "lineNumber": 169899,
      "originalJapaneseLine": "　ちょっと様子を見に来たわん」",
      "translatedEnglishLine": "so we came to take a look, wan.\""
    },
    {
      "lineNumber": 169900,
      "originalJapaneseLine": "「さすが、ヨシフ。",
      "translatedEnglishLine": "\"As expected, Yosif."
    },
    {
      "lineNumber": 169901,
      "originalJapaneseLine": "　ケイブリス様の言うことを",
      "translatedEnglishLine": "You’re truly following everything Lord Keivris says,"
    },
    {
      "lineNumber": 169902,
      "originalJapaneseLine": "　ちゃーんと守ってるわんね」",
      "translatedEnglishLine": "wan.\""
    },
    {
      "lineNumber": 169903,
      "originalJapaneseLine": "「ははっ！　ありがたき幸せ！」",
      "translatedEnglishLine": "\"Ha ha! I am deeply honored!\""
    },
    {
      "lineNumber": 169904,
      "originalJapaneseLine": "「あ、そういえば、",
      "translatedEnglishLine": "\"Ah, by the way,"
    },
    {
      "lineNumber": 169905,
      "originalJapaneseLine": "　この国の女王はどうしたにゃん？",
      "translatedEnglishLine": "what happened to the queen of this country, nyan?"
    },
    {
      "lineNumber": 169906,
      "originalJapaneseLine": "　もう殺しちまったかにゃん？」",
      "translatedEnglishLine": "Have you already killed her, nyan?\""
    },
    {
      "lineNumber": 169907,
      "originalJapaneseLine": "「いえ、まだ生かしてあります」",
      "translatedEnglishLine": "\"No, she is still alive.\""
    },
    {
      "lineNumber": 169908,
      "originalJapaneseLine": "「人間界には同族の女をセックス専用の",
      "translatedEnglishLine": "\"In the human world, there is an unbelievable culture where women of the same kind are remodeled as sex-only"
    },
    {
      "lineNumber": 169909,
      "originalJapaneseLine": "　穴奴隷という貶めた存在に改造するという、",
      "translatedEnglishLine": "hole slaves, a degraded existence.\""
    },
    {
      "lineNumber": 169910,
      "originalJapaneseLine": "　信じられない文化がありましてな」",
      "translatedEnglishLine": "\"There is such an unbelievable culture.\""
    },
    {
      "lineNumber": 169911,
      "originalJapaneseLine": "「今、女王は、ケイブリス様への貢ぎ物として",
      "translatedEnglishLine": "\"Right now, the queen is being remodeled so she can be used"
    },
    {
      "lineNumber": 169912,
      "originalJapaneseLine": "　使えるように改造を命じているところです」",
      "translatedEnglishLine": "as an offering to Lord Keivris.\""
    },
    {
      "lineNumber": 169913,
      "originalJapaneseLine": "「うんうん、それを聞いて安心したわん。",
      "translatedEnglishLine": "\"Mm-hmm, hearing that puts me at ease, wan."
    },
    {
      "lineNumber": 169914,
      "originalJapaneseLine": "　リス様ったら抱いてみたいから、",
      "translatedEnglishLine": "Lord Lis said he wants to embrace her,"
    },
    {
      "lineNumber": 169915,
      "originalJapaneseLine": "　可能なら連れてこいって言うもんだから」",
      "translatedEnglishLine": "and told us to bring her if possible.\""
    },
    {
      "lineNumber": 169916,
      "originalJapaneseLine": "「は、そういうことでしたら、",
      "translatedEnglishLine": "\"I-is that so, then"
    },
    {
      "lineNumber": 169917,
      "originalJapaneseLine": "　もうしばし時間を頂けますかな？」",
      "translatedEnglishLine": "please grant me just a little more time?\""
    },
    {
      "lineNumber": 169918,
      "originalJapaneseLine": "「別にニャン達はそれでいいにゃん」",
      "translatedEnglishLine": "\"We kitties don’t mind that at all, nyan.\""
    },
    {
      "lineNumber": 169919,
      "originalJapaneseLine": "「ええ、その方がリス様が喜ぶなら、",
      "translatedEnglishLine": "\"Yes, if that will make Lord Lis happy,"
    },
    {
      "lineNumber": 169920,
      "originalJapaneseLine": "　ちゃーんと言っておくから安心なさい」",
      "translatedEnglishLine": "I will make sure to tell him properly, so rest assured.\""
    },
    {
      "lineNumber": 169921,
      "originalJapaneseLine": "「ありがとうございます」",
      "translatedEnglishLine": "\"Thank you very much.\""
    },
    {
      "lineNumber": 169922,
      "originalJapaneseLine": "「ククク、必ずや、ケイブリス様も満足される",
      "translatedEnglishLine": "\"Heh heh heh, I will definitely make her transform into a hole slave"
    },
    {
      "lineNumber": 169923,
      "originalJapaneseLine": "　穴奴隷へと変貌させてみせますので」",
      "translatedEnglishLine": "that will satisfy Lord Keivris.\""
    },
    {
      "lineNumber": 169924,
      "originalJapaneseLine": "「しかし、穴奴隷に改造わんか……",
      "translatedEnglishLine": "\"But, remodeling into a hole slave, wan... I wonder"
    },
    {
      "lineNumber": 169925,
      "originalJapaneseLine": "　いったいどんなことしてるのかしら」",
      "translatedEnglishLine": "what kind of things they do for that.\""
    },
    {
      "lineNumber": 169926,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "…………"
    },
    {
      "lineNumber": 169927,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "……"
    },
    {
      "lineNumber": 169928,
      "originalJapaneseLine": "石壁と石畳に囲まれた硬質な地下室に、",
      "translatedEnglishLine": "In a hard underground chamber surrounded by stone walls and stone paving,"
    },
    {
      "lineNumber": 169929,
      "originalJapaneseLine": "カチャカチャという機具の音が鳴っていた。",
      "translatedEnglishLine": "the clattering sound of machinery could be heard."
    },
    {
      "lineNumber": 169930,
      "originalJapaneseLine": "ここはリーザスの都市、リッチにある、",
      "translatedEnglishLine": "This is in the Liesath city of Rich,"
    },
    {
      "lineNumber": 169931,
      "originalJapaneseLine": "調教師の為に作られた調教専用の部屋だった。",
      "translatedEnglishLine": "a room dedicated to training created for trainers."
    },
    {
      "lineNumber": 169932,
      "originalJapaneseLine": "一人の女性が長い眠りから目を覚まし、",
      "translatedEnglishLine": "A woman woke from a long sleep,"
    },
    {
      "lineNumber": 169933,
      "originalJapaneseLine": "うつろな声を漏らしていた。",
      "translatedEnglishLine": "uttering a vacant voice."
    },
    {
      "lineNumber": 169934,
      "originalJapaneseLine": "「う……う、ああ……」",
      "translatedEnglishLine": "\"U... u, ah...\""
    },
    {
      "lineNumber": 169935,
      "originalJapaneseLine": "あれからどれだけの日数が経過しただろう。",
      "translatedEnglishLine": "How many days have passed since then, I wonder."
    },
    {
      "lineNumber": 169936,
      "originalJapaneseLine": "時計すら見せてもらえない地下の生活では、",
      "translatedEnglishLine": "In the underground life where she was not even shown a clock,"
    },
    {
      "lineNumber": 169937,
      "originalJapaneseLine": "リアには今が朝か昼か夜かすら把握する術はない。",
      "translatedEnglishLine": "Ria had no way of knowing whether it was morning, afternoon, or night."
    },
    {
      "lineNumber": 169938,
      "originalJapaneseLine": "手術台に寝かされて、調教師に注射をされて眠れば、",
      "translatedEnglishLine": "Lying on the operating table, injected by a trainer and falling asleep,"
    },
    {
      "lineNumber": 169939,
      "originalJapaneseLine": "起きた時、体が前と少し変わっている。それの繰り返しだった。",
      "translatedEnglishLine": "when she awakened, her body was slightly changed from before. This repeated over and over."
    },
    {
      "lineNumber": 169940,
      "originalJapaneseLine": "水を入れられて柔らかさを維持したまま膨らんだ乳房、",
      "translatedEnglishLine": "Her breasts were filled with water, swelling while retaining softness,"
    }
  ]
}

